import React from 'react';

import {
  BrowserRouter as Router,
  Route,
  Routes,
} from 'react-router-dom';

import Auth from './Auth';

function Routs(){
    return(
        <Router>

        <Routes>
          <Route exact path="/" element={<Auth/>}/>
          <Route   path="/register"  element={<App/>}/>
          {console.log('show auth')}
       
      
        </Routes>
    
      </Router>
    )
}
export default Routs;
